tables.table_schema:
CREATE TABLE RegressionResults (
	id INT PRIMARY KEY,
	model_name VARCHAR,
	r_squared DECIMAL,
	coefficients JSON
);

CREATE TABLE StockTrends (
	id INT PRIMARY KEY,
	date DATE,
	stock_symbol VARCHAR,
	trend VARCHAR
);

CREATE TABLE stock_symbols (
    id SERIAL PRIMARY KEY,
    symbol_name VARCHAR(50) NOT NULL
);

CREATE TABLE regression_models (
    id SERIAL PRIMARY KEY,
    model_name VARCHAR(50) NOT NULL,
    model_version VARCHAR(20) NOT NULL,
    model_type VARCHAR(20) NOT NULL
);
